import React from 'react'
import PropTypes from 'prop-types'
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Input from '@material-ui/core/Input';
import Button from '@material-ui/core/Button';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';

const renderInfoYear = infoYear  => {
    
    const renderInfo = el => (<> <li> {el._id }</li><li> {el.brand }</li> </>)

    return infoYear.map(renderInfo)
}

const CarByYear = ({onYearOption,handleChange,year,infoYear}) => {
    return (
        <>
          <FormControl>
              <InputLabel htmlFor="year">Año del coche</InputLabel>
              <Input id="year" onChange={handleChange}/>
              <Button variant="contained" color="primary" onClick = {() => onYearOption(year)} >
                 Buscar
            </Button>
            <Table>
                <TableHead>
                    <TableRow>
                    <TableCell padding="default">CoverageType</TableCell>
                    <TableCell padding="default">Id</TableCell>
                    <TableCell align="right">Brand</TableCell>
                    <TableCell align="right">Company</TableCell>
                    <TableCell align="right">Price</TableCell>
                    <TableCell align="right">Extra Coverage Price</TableCell>
                    <TableCell align="right">Year Range</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {infoYear.map(el => ([
                    <TableRow key={el._id}>
                        <TableCell padding="default">{el.coverageType}</TableCell>
                        <TableCell padding="default">{el._id}</TableCell>
                        <TableCell padding="default">{el.brand}</TableCell>
                        <TableCell padding="default">{el.company}</TableCell>
                        <TableCell padding="default">{el.price}</TableCell>
                        <TableCell padding="default">{el.extraCoveragePrice}</TableCell>
                        <TableCell padding="default">{ `${el.yearRange[0]} ` }</TableCell>
                    </TableRow>
                    ]))}
                </TableBody>
             </Table>
            {
                renderInfoYear(infoYear)
            }
           </FormControl>
        </>
    )
}

CarByYear.propTypes = {

}

export default CarByYear
